import React from 'react'
import Pic1 from '../images/'


import { useNavigate } from 'react-router-dom';
import PageHeader from '../../Component/PageHeader/PageHeader';

export default function FlashStampRawMaterial() {
  
    const data = [
        {id: 1, title : "Material 1 ", description : "this is best quality Raw Material" , image: Pic1  },
        {id: 2, title : "Material 2 ", description : "this is best quality Raw Material" , image: Pic2  },
        {id: 3, title : "Material 3 ", description : "this is best quality Raw Material" , image: Pic3  },
        {id: 4, title : "Material 4 ", description : "this is best quality Raw Material" , image: Pic4  },
        {id: 5, title : "Material 5 ", description : "this is best quality Raw Material" , image: Pic5  },
        {id: 6, title : "Material 6 ", description : "this is best quality Raw Material" , image: Pic6  },
        {id: 7, title : "Material 7 ", description : "this is best quality Raw Material" , image: Pic7  },
        {id: 8, title : "Material 8 ", description : "this is best quality Raw Material" , image: Pic8  },
    ] ;

const navigate = useNavigate();
 
const handleContact = ()=>{
    navigate("/contactus");
}

  return (
    <>

   <PageHeader  topheading="Flash Stamp Raw Materials" title="flashstamprawmaterial" />

    <div className="container">
        <div className="cards-container">
            {
            data.map((item)=>(
                <div key={item.id} className="card">
                    <img src={item.image} alt={item.title} className='card-image' />
                   <div className="card-content">
                    <h3>{item.title}</h3>
                    <p>{item.description}</p>
                     <button 
                     onClick={handleContact}
                     className='card-button'
                     >
                      Details
                     </button>
                   </div>
                </div>
            ))
            }
        </div>
    </div>
      
    </>
  )
}
